		e[4*5+4] = px4;	
		break;
	case 40405: 
		e[0*5+0] = 1;	e[0*5+1] = pi;	e[0*5+2] = pi2;	e[0*5+3] = pi3;	e[0*5+4] = pi4;	
		e[1*5+1] = px;	e[1*5+2] = 2*pi*px;	e[1*5+3] = 3*pi2*px;	e[1*5+4] = 4*pi3*px;	
		e[2*5+2] = px2;	e[2*5+3] = 3*pi*px2;	e[2*5+4] = 6*pi2*px2;	
		e[3*5+3] = px3;	e[3*5+4] = 4*pi*px3;	
		e[4*5+4] = px4;	
		break;
	case 30405: 
		e[1*5+1] = 1;	e[1*5+2] = pi;	e[1*5+3] = pi2;	e[1*5+4] = pi3;	
		e[2*5+2] = px;	e[2*5+3] = 2*pi*px;	e[2*5+4] = 3*pi2*px;	
		e[3*5+3] = px2;	e[3*5+4] = 3*pi*px2;	
		e[4*5+4] = px3;	
		break;
	case 20405: 
		e[2*5+2] = 1;	e[2*5+3] = pi;	e[2*5+4] = pi2;	
		e[3*5+3] = px;	e[3*5+4] = 2*pi*px;	
